export const FeatureChange = (a) => {
  return {
    type: "ADD_A_CONTENT",
    payload: a,
  };
};
export const FeatureDelete = (a) => {
  return {
    type: "FEATUREDEL_A_CONTENT",
    payload: a,
  };
};
export const FeatureAdd = (a) => {
  return {
    type: "FEATUREADD_A_CONTENT",
    payload: a,
  };
};
export const ProjAdd = (newData) => {
  //  console.log(a);
  return {
    type: "NEW_A_CONTENT",
    payload: newData,
  };
};
export const ProjDelete = (del) => {
  console.log(del);
  return {
    type: "DEL_A_CONTENT",
    payload: del,
  };
};

export const Changename = (name, id) => {
  console.log(name, id);
  return {
    type: "CHA_A_CONTENT",
    payload: name,
    id: id,
  };
};
